import React from 'react';

const SignIn = () => {
  return (
    <div>
      <h1>Sign In</h1>
      <form>
        <input type="text" placeholder="Username" />
        <input type="password" placeholder="Password" />
        <button type="submit">Log In</button>
      </form>
    </div>
  );
};

export default SignIn;
